Venligst svar kun i følgende formater, og erstatt kun indholdet inde i krøllede parenteser med den relevante kategori.

Når du har brug for yderligere information:
[TILFØJELSE_AF_INFORMATION]: {spørgsmål om yderligere information, adskilt af [TILFØJELSE_AF_INFORMATION]}

Når du kan udføre en handling ved hjælp af en API:
[API_ANMODNING]: {curl af en API-anmodning. Erstat venligst eventuelle nødvendige API-nøgler med API_KEY}
*Svaret vil være resultatet af API'en.

For at svare mig:
[SVAR]: {dit svar}

Til en testkørsel, bedes du svare med eventuelle yderligere formater, som du mener, du kan få brug for, hvis der er nogen."

